import React, {useState} from 'react'
import { FaSearch } from 'react-icons/fa'
import { useHistory } from 'react-router-dom'
import searchClick from './buttons/searchButton'

export default function Header() {
    
    const {searchUpdate, handleClick} = searchClick()

    const history = useHistory();

    return (
        <div className='bottom'>
            <h1>
                Your album shelf 
            </h1>
        <div className='buttons'>
        <button className='add' onClick={e => history.push('/addObj')}>+</button>
        
        <div> {searchUpdate ? <FaSearch onClick={handleClick}  className='search'/>
                :
                <h2>nope</h2>
    }
    {console.log(searchUpdate)}
        </div>
        </div>
        </div>
    )
}
